INSERT INTO `clases` (`id`, `title`, `start`, `end`, `description`, `color`, `textColor`, `teacher_lessons`, `namegroup_lessons`) VALUES (1, 'SOCIALES - FIGUEREDO 2:00 PM', '2021-07-15 14:00:00', '2021-07-15 14:00:00', 'The Lore Documentation System, out of the box, is specialized for documenting Twisted. Its markup includes CSS classes for Python, HTML, filenames, and other Twisted-focused categories. But don\'t think this means Lore can\'t be used for other documentation tasks! Lore is designed to allow extensions, giving any Python programmer the ability to customize Lore for documenting almost anything.', '#0036fa', '#FFFFFF', 'LEIDY MELISSA BEDOYA', 'GRUPO EDUCATIVO ABEL MENDOZA');
